import { Link } from 'react-router-dom';
import './App.css';

function App() {

  return (
    <div className="App">
      <header className="App-header">
        <h1>React Playground</h1>
      </header>

<div></div>
      <Link to="/user">User</Link>
      <Link to="/config">Config</Link>

    </div>
  );
}

export default App;
